// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './componentes-comunes/Sidebar';
import Navbar from './componentes-comunes/Navbar';
import Footer from './componentes-comunes/Footer';
import Dashboard from './administrador/paginas/Dashboard';

// Importa las nuevas páginas
import UsuariosPropietarios from './administrador/paginas/UsuariosPropietarios';
import UsuariosInquilinos from './administrador/paginas/UsuariosInquilinos';
import UsuariosEmpleados from './administrador/paginas/UsuariosEmpleados';
import RolesPermisos from './administrador/paginas/RolesPermisos';
import Departamentos from './administrador/paginas/Departamentos';
import Cocheras from './administrador/paginas/Cocheras';
import SolicitudesServicio from './administrador/paginas/SolicitudesServicio';
import HistorialSolicitudes from './administrador/paginas/HistorialSolicitudes';
import Reservas from './administrador/paginas/Reservas';
import ConfiguracionAreas from './administrador/paginas/ConfiguracionAreas';
import Correspondencia from './administrador/paginas/Correspondencia';
import Eventos from './administrador/paginas/Eventos';
import VerificacionPagos from './administrador/paginas/VerificacionPagos';
import EstadosCuenta from './administrador/paginas/EstadosCuenta';
import Facturacion from './administrador/paginas/Facturacion';
import DocumentosLegales from './administrador/paginas/DocumentosLegales';
import Reglamentos from './administrador/paginas/Reglamentos';

const App = () => {
    return (
        <Router>
            <div className="app-container">
                <Sidebar />
                <div className="main-content">
                    <Navbar />
                    <Routes>
                        <Route path="/dashboard" element={<Dashboard />} />
                        {/* Usuarios */}
                        <Route path="/usuarios/propietarios" element={<UsuariosPropietarios />} />
                        <Route path="/usuarios/inquilinos" element={<UsuariosInquilinos />} />
                        <Route path="/usuarios/empleados" element={<UsuariosEmpleados />} />
                        {/* Roles y Permisos */}
                        <Route path="/roles-permisos" element={<RolesPermisos />} />
                        {/* Propiedades */}
                        <Route path="/propiedades/departamentos" element={<Departamentos />} />
                        <Route path="/propiedades/cocheras" element={<Cocheras />} />
                        {/* Mantenimiento */}
                        <Route path="/mantenimiento/solicitudes" element={<SolicitudesServicio />} />
                        <Route path="/mantenimiento/historial" element={<HistorialSolicitudes />} />
                        {/* Áreas Comunes */}
                        <Route path="/areas-comunes/reservas" element={<Reservas />} />
                        <Route path="/areas-comunes/configuracion" element={<ConfiguracionAreas />} />
                        {/* Correspondencia */}
                        <Route path="/correspondencia" element={<Correspondencia />} />
                        {/* Eventos */}
                        <Route path="/eventos" element={<Eventos />} />
                        {/* Pagos */}
                        <Route path="/pagos/verificacion" element={<VerificacionPagos />} />
                        <Route path="/pagos/estados-de-cuenta" element={<EstadosCuenta />} />
                        <Route path="/pagos/facturacion" element={<Facturacion />} />
                        {/* Documentos */}
                        <Route path="/documentos/legales" element={<DocumentosLegales />} />
                        <Route path="/documentos/reglamentos" element={<Reglamentos />} />
                    </Routes>
                    <Footer />
                </div>
            </div>
        </Router>
    );
};

export default App;
